import React, { Component } from 'react';
import classes from './CommentList.module.scss';

class CommentList extends Component {
	render() {
		return (
			<React.Fragment>
				<div className={classes.CommentList}>
					<div className={classes.User}>
						<p>Marko Djuric</p>
					</div>
					<div className={classes.Title}>
						<p>This is a title of a damn comment</p>
					</div>
					<div className={classes.Comment}>
						<p>
							This is a comment of a damn comment. Here a user can choose whatever the text he wants to
							apply to this missing p tag that I was too stupid to put here. Anyhow these Nike shoes are
							awesome and this is the official comment of me. Hue hue hue.
						</p>
					</div>
				</div>
			</React.Fragment>
		);
	}
}

export default CommentList;
